// client/src/components/Signup.jsx
import React, { useState } from "react";
import API from "../api";
import { useNavigate } from "react-router-dom";

export default function Signup() {
  const [form, setForm] = useState({
    email: "",
    password: "",
    company: { name: "", website: "", stage: "", domain: "", summary: "" },
  });
  const [loading, setLoading] = useState(false);
  const [msg, setMsg] = useState("");
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith("company.")) {
      const key = name.split(".")[1];
      setForm((s) => ({ ...s, company: { ...s.company, [key]: value } }));
    } else setForm((s) => ({ ...s, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setMsg("");
    try {
      const res = await API.post("/auth/signup", form);
      setMsg(res.data.message || "Check your email for verification link");
      setLoading(false);
      // Optionally navigate to a "check email" screen
    } catch (err) {
      setLoading(false);
      setMsg(err.response?.data?.message || "Error creating account");
    }
  };

  return (
    <div className="container mt-5">
      <h2>Sign up â€” BioDeck (Founder)</h2>
      <p>Create an account and your company profile</p>
      {msg && <div className="alert alert-info">{msg}</div>}
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Email</label>
          <input name="email" value={form.email} onChange={handleChange} required type="email" className="form-control" />
        </div>

        <div className="mb-3">
          <label className="form-label">Password</label>
          <input name="password" value={form.password} onChange={handleChange} required type="password" className="form-control" />
        </div>

        <hr />
        <h5>Company details</h5>
        <div className="mb-3">
          <label className="form-label">Company name</label>
          <input name="company.name" value={form.company.name} onChange={handleChange} required className="form-control" />
        </div>
        <div className="mb-3">
          <label className="form-label">Website</label>
          <input name="company.website" value={form.company.website} onChange={handleChange} className="form-control" />
        </div>
        <div className="mb-3">
          <label className="form-label">Stage (Seed/Series A/...)</label>
          <input name="company.stage" value={form.company.stage} onChange={handleChange} className="form-control" />
        </div>
        <div className="mb-3">
          <label className="form-label">Domain (e.g., oncology)</label>
          <input name="company.domain" value={form.company.domain} onChange={handleChange} className="form-control" />
        </div>
        <div className="mb-3">
          <label className="form-label">Short summary</label>
          <textarea name="company.summary" value={form.company.summary} onChange={handleChange} className="form-control" />
        </div>

        <button className="btn btn-primary" disabled={loading}>
          {loading ? "Creating..." : "Create account"}
        </button>
      </form>
    </div>
  );
}
